--
-- Name: delete_ahsp_items_from_others(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.delete_ahsp_items_from_others() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    DELETE FROM table_ahsp WHERE kode_ahsp = OLD.kode_ahsp;
    DELETE FROM table_items WHERE kode_item = OLD.kode;
    DELETE FROM table_komponen WHERE id = OLD.id;
    RETURN OLD;
END;
$$;


ALTER FUNCTION public.delete_ahsp_items_from_others() OWNER TO postgres;

--
-- Name: sync_ahsp_items_to_others(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.sync_ahsp_items_to_others() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Sinkronisasi ke table_ahsp

    VALUES (NEW.kode_ahsp, NEW.nama_ahsp)
    ON CONFLICT (kode_ahsp) DO UPDATE SET
        nama_ahsp = EXCLUDED.nama_ahsp;

    -- Sinkronisasi ke table_items

    VALUES (NEW.kode, NEW.item, NEW.kategori, NEW.satuan)
    ON CONFLICT (kode_item) DO UPDATE SET
        nama_item = EXCLUDED.nama_item,
        kategori = EXCLUDED.kategori,
        satuan = EXCLUDED.satuan;

    -- Sinkronisasi ke table_komponen

    VALUES (NEW.id, NEW.kode_ahsp, NEW.kode, NEW.item, NEW.satuan, NEW.koefisien)
    ON CONFLICT (id) DO UPDATE SET
        kode_ahsp = EXCLUDED.kode_ahsp,
        kode_item = EXCLUDED.kode_item,
        nama_item = EXCLUDED.nama_item,
        satuan = EXCLUDED.satuan,
        koefisien = EXCLUDED.koefisien;

    RETURN NEW;
END;
$$;


ALTER FUNCTION public.sync_ahsp_items_to_others() OWNER TO postgres;

