-- Name: referensi_ahspreferensi; Type: TABLE; Schema: public; Owner: postgres
--

CREATE TABLE public.referensi_ahspreferensi (
    id bigint NOT NULL,
    kode_ahsp character varying(50) NOT NULL,
    nama_ahsp text NOT NULL,
    satuan character varying(50),
    source_file character varying(100),
    sumber character varying(100) NOT NULL,
    klasifikasi character varying(100),
    sub_klasifikasi character varying(100),
    search_vector tsvector GENERATED ALWAYS AS ((((setweight(to_tsvector('indonesian'::regconfig, (COALESCE(kode_ahsp, ''::character varying))::text), 'A'::"char") || setweight(to_tsvector('indonesian'::regconfig, COALESCE(nama_ahsp, ''::text)), 'B'::"char")) || setweight(to_tsvector('indonesian'::regconfig, (COALESCE(klasifikasi, ''::character varying))::text), 'C'::"char")) || setweight(to_tsvector('indonesian'::regconfig, (COALESCE(sub_klasifikasi, ''::character varying))::text), 'C'::"char"))) STORED
);


ALTER TABLE public.referensi_ahspreferensi OWNER TO postgres;

--
-- Name: COLUMN referensi_ahspreferensi.search_vector; Type: COMMENT; Schema: public; Owner: postgres
--

COMMENT ON COLUMN public.referensi_ahspreferensi.search_vector IS 'Full-text search vector (auto-generated). Weighted: A=code, B=name, C=classification';


