--
-- Name: referensi_ahsp_stats; Type: MATERIALIZED VIEW; Schema: public; Owner: postgres
--

CREATE MATERIALIZED VIEW public.referensi_ahsp_stats AS
 SELECT ahsp.id AS ahsp_id,
    ahsp.kode_ahsp,
    ahsp.nama_ahsp,
    ahsp.klasifikasi,
    ahsp.sub_klasifikasi,
    ahsp.satuan,
    ahsp.sumber,
    ahsp.source_file,
    count(DISTINCT r.id) AS rincian_total,
    count(DISTINCT r.id) FILTER (WHERE ((r.kategori)::text = 'TK'::text)) AS tk_count,
    count(DISTINCT r.id) FILTER (WHERE ((r.kategori)::text = 'BHN'::text)) AS bhn_count,
    count(DISTINCT r.id) FILTER (WHERE ((r.kategori)::text = 'ALT'::text)) AS alt_count,
    count(DISTINCT r.id) FILTER (WHERE ((r.kategori)::text = 'LAIN'::text)) AS lain_count,
    count(DISTINCT r.id) FILTER (WHERE (r.koefisien = (0)::numeric)) AS zero_coef_count,
    count(DISTINCT r.id) FILTER (WHERE ((r.satuan_item IS NULL) OR ((r.satuan_item)::text = ''::text))) AS missing_unit_count
   FROM (public.referensi_ahspreferensi ahsp
     LEFT JOIN public.referensi_rincianreferensi r ON ((r.ahsp_id = ahsp.id)))
  GROUP BY ahsp.id, ahsp.kode_ahsp, ahsp.nama_ahsp, ahsp.klasifikasi, ahsp.sub_klasifikasi, ahsp.satuan, ahsp.sumber, ahsp.source_file
  WITH NO DATA;


ALTER TABLE public.referensi_ahsp_stats OWNER TO postgres;

